const SignIn = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [process, setProcess] = useState(false);
  const navigate = useNavigate();
  const isUser = userAuth()

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };
  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const onSubmit = (e) => {
    e.preventDefault();
    setProcess(true);
    const configuration = {
      method: "POST",
      url: "https://nxentradebackend.onrender.com/sign-in",
      headers: {'Content-Type': 'application/json'},
      data: {
        email: email,
        password: password,
      },
    };

    axios(configuration)
      .then((result) => {
        setProcess(false);
        setEmail("");
        setPassword("");
        const _id = result.data.userId;
        const secretPass = "Xkhzg478tYUAEQivas6510000056444";
        toast.success("Signed in successfully");

        const data = CryptoJS.AES.encrypt(
          JSON.stringify(_id),
          secretPass
        ).toString();
        Cookies.set("Token", data, { path: "/", expires: 3 });
        navigate("/");
        window.location.reload(true);
      })
      .catch((error) => {
        setProcess(false);
        setEmail("");
        setPassword("");
        toast.error(error.response.data.message);
      });
  };

  if(isUser) {
   return navigate("/");
  }
  return (
    <>
      <Navbar />
      <Toaster position="top-center" richColors></Toaster>

      <div className="container relative flex pt-20 flex-col items-center justify-center lg:px-0">
        <div className="mx-auto flex w-full flex-col justify-center space-y-6 sm:w-[350px]">
          <div className="flex flex-col items-center space-y-2 text-center">
            <Icons.logo />
            <h1 className="text-2xl font-bold">sign in your acount</h1>
            <Link
              className={buttonVariants({
                variant: "link",
                className: "gap-1.5",
              })}
              to="/sign-up"
            >
              Don&apos;t have an account
              <ArrowRight className="h-4 w-4" />
            </Link>
          </div>

          <div className="grid gap-6">
            <form onSubmit={onSubmit}>
              <div className="grid gap-2">
                <div className="grid gap-1 py-2">
                  <Label htmlFor="email">Email</Label>
                  <input
                    type="email"
                    name="email"
                    style={{ padding: "10px" }}
                    onChange={handleEmailChange}
                    value={email}
                    placeholder="you@example.com"
                  />
                </div>

                <div className="grid gap-1 py-2">
                  <Label htmlFor="password">Password</Label>
                  <input
                    type="password"
                    name="password"
                    style={{ padding: "10px" }}
                    onChange={handlePasswordChange}
                    value={password}
                    placeholder="password"
                  />
                </div>

                <Button>
                  {process ? (
                    <Loader2 className="animate-spin h-8 w-8 text-zinc-600" />
                  ) : (
                    "Sign Up"
                  )}
                </Button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </>
  );
};

export default SignIn;
